exports=async function(bid,options){const{parseCatalogPaginate,cleanCatalogWrapper}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://www.czyefang.com/book/${bid}/get_${page}.html`,"dl.panel-chapterlist",{...options,clientOptions,pageSize:20,totalPagesRegex:/value="\/book\/[a-zA-Z\d_-]+\/get_(?<totalPages>\d+)\.html"[^>]*>[^<]+<\/option>\s*<\/select/,idRegex:/(?<id>[a-zA-Z\d_-]+)\.html/})};